import{img2} from './img2.jpg';
import {img3} from './img3.jpeg';
import{img4} from './img4.jpg';


const image = [
  {
    image:{img1},
    title: "Automos Process",
  },
  {
    image:{img2},
    title: "Control panels",
  },
  {
    image:{img3},
    title: "PLC controlers",
  },
  {
    image:{img4},
    title: "Software Training",
  },
];
export default image;
